import {
  Container,
  createTheme,
  ThemeProvider,
  Grid,
  TextField,
  Typography,
  Button,
  Box,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import myIcon from "../Assets/icon.png";

const customTheme = createTheme({
  palette: {
    primary: { main: "#D6CC99" },
    secondary: { main: "#445D48" },
  },
});

const Header = () => {
  const navigate = useNavigate();

  const handleClickHome = async () => {
    navigate("/");
  };

  return (
    <ThemeProvider theme={customTheme}>
      <Container
        sx={{
          height: "10vh",
          minWidth: "100%",
        }}
      >
        <Grid
          container
          direction="column"
          sx={{
            color: "white",
            height: "15vh",
          }}
        >
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "left",
            }}
            alignItems="left"
          >
            <Box
              component="img"
              sx={{
                height: "200px",
                width: "200px",
                maxHeight: { xs: "233px", md: "167px" },
                maxWidth: { xs: "350px", md: "250px" },
                backgroundImage: myIcon,
                alignItems: "left",
              }}
              src={myIcon}
            />
          </Grid>
          <Grid
            alignItems="right"
            justifyContent="space-evenly"
            direction="column"
          >
            <Grid
              item
              sx={{
                width: { xs: "200px", lg: "200px" },
                display: "flex",
                justifyContent: "space-evenly",
                alignItems: "right",
              }}
            >
              <Button onClick={() => handleClickHome()}>
                <Typography textTransform="none" color="primary" variant="h6">
                  •{" "}
                </Typography>
                <Typography color="inherit" noWrap>
                  &nbsp;
                </Typography>
                <Typography textTransform="none" color="secondary" variant="h6">
                  Projects
                </Typography>
              </Button>
            </Grid>
            <Grid
              item
              sx={{
                width: { xs: "200px", lg: "200px" },
                display: "flex",
                justifyContent: "space-evenly",
                alignItems: "right",
              }}
            >
              <Button onClick={() => handleClickHome()}>
                <Typography textTransform="none" color="primary" variant="h6">
                  •{" "}
                </Typography>
                <Typography color="inherit" noWrap>
                  &nbsp;
                </Typography>
                <Typography textTransform="none" color="secondary" variant="h6">
                  About Me
                </Typography>
              </Button>
            </Grid>
            <Grid
              item
              sx={{
                width: { xs: "200px", lg: "200px" },
                display: "flex",
                justifyContent: "space-evenly",
                alignItems: "right",
              }}
            >
              <Button onClick={() => handleClickHome()}>
                <Typography textTransform="none" color="primary" variant="h6">
                  •{" "}
                </Typography>
                <Typography color="inherit" noWrap>
                  &nbsp;
                </Typography>
                <Typography textTransform="none" color="secondary" variant="h6">
                  Contact
                </Typography>
              </Button>
            </Grid>
            <Grid
              item
              sx={{
                width: { xs: "200px", lg: "200px" },
                display: "flex",
                justifyContent: "space-evenly",
                alignItems: "right",
              }}
            >
              <Button
                color="secondary"
                onClick={() => handleClickHome()}
                variant="outlined"
              >
                Resume
              </Button>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
};

export default Header;
